import React from "react";
import { Box, Button, Typography, Select, MenuItem } from "@mui/material";
import HomeIcon from "@mui/icons-material/Home";
import { useNavigate, useParams } from "react-router-dom";
import ChampionHeader from "../components/championDetails/ChampionHeader";
import ButtonBar from "../components/championDetails/ButtonBar";
import PrimaryMasteryTree from "../components/championDetails/PrimaryMasteryTree";
import { RuneFamily } from "../types/Rune";

interface RouteParams {
  [key: string]: string | undefined;
  championName: string;
}

const ChampionDetails: React.FC = () => {
  const { championName } = useParams<RouteParams>() || "Garen";
  const championImageUrl = `https://ddragon.leagueoflegends.com/cdn/img/champion/loading/${championName}_0.jpg`;
  const navigate = useNavigate();
  return (
    <Box sx={{ p: 2, backgroundColor: "#010A13" }}>
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
          mb: 2,
        }}
      >
        <Button
          variant="outlined"
          startIcon={<HomeIcon />}
          onClick={() => navigate("/")}
        >
          Home
        </Button>
        <input
          type="text"
          placeholder="Rechercher un champion..."
          style={{
            width: "60%",
            padding: "8px",
            borderRadius: "4px",
            border: "1px solid #ccc",
          }}
        />
      </Box>
      <ChampionHeader
        name={championName || "Garen"}
        winrate={52.4}
        pickrate={12.6}
        banrate={6.5}
        totalGames={1234}
      />
      <Box sx={{ display: "flex", gap: "16px" }} id="JOHNNY">
        <Box
          sx={{
            width: "20%",
            height: "100%",
            overflow: "hidden",
            borderRadius: "2%",
            paddingRight: "-20%",
          }}
        >
          <Box
            component="img"
            src={championImageUrl}
            alt="Champion"
            sx={{
              width: "180%", // jouer avec ce param
              height: "auto",
              objectFit: "cover", // Remplit le conteneur en recadrant l'image
              objectPosition: "top", // Ajuste la position pour garder la partie souhaitée
              paddingRight: "47%",
            }}
          />
        </Box>
        <Box
          sx={{
            display: "flex",
            flexDirection: "column",
            gap: "16px",
            width: "100%",
          }}
          id="coiffeur"
        >
          <ButtonBar name={championName || ""} />
          <Box>
            <Box
              sx={{
                display: "flex",
                gap: "16px",
                mb: 2,
              }}
            >
              <Box
                sx={{
                  flex: "2",
                  border: "1px solid #ccc",
                  p: 1,
                  minHeight: "300px",
                }}
              >
                <PrimaryMasteryTree tree={RuneFamily.Precision} runes={[0,0]}/>
              </Box>
              <Box
                sx={{
                  flex: "1",
                  display: "flex",
                  flexDirection: "column",
                  gap: "16px",
                }}
              >
                <Box
                  sx={{
                    border: "1px solid #ccc",
                    p: 1,
                    minHeight: "140px",
                  }}
                >
                  <Typography variant="subtitle1">
                    Arbre de maîtrises secondaires
                  </Typography>
                </Box>
                <Box
                  sx={{
                    border: "1px solid #ccc",
                    p: 1,
                    minHeight: "100px",
                  }}
                >
                  <Typography variant="subtitle1">Spell Order</Typography>
                </Box>
              </Box>
            </Box>
            <Box
              sx={{
                display: "flex",
                gap: "16px",
              }}
            >
              <Box
                sx={{
                  flex: "1",
                  border: "1px solid #ccc",
                  p: 1,
                }}
              >
                <Typography variant="subtitle1">Runes</Typography>
              </Box>
              <Box
                sx={{
                  flex: "1",
                  border: "1px solid #ccc",
                  p: 1,
                }}
              >
                <Typography variant="subtitle1">Sorts d'invocateur</Typography>
              </Box>
              <Box
                sx={{
                  flex: "2",
                  display: "flex",
                  flexDirection: "column",
                  gap: "16px",
                }}
              >
                <Box
                  sx={{
                    border: "1px solid #ccc",
                    p: 1,
                  }}
                >
                  <Typography variant="subtitle1">Objets de départ</Typography>
                </Box>
                <Box
                  sx={{
                    border: "1px solid #ccc",
                    p: 1,
                  }}
                >
                  <Typography variant="subtitle1">Core Build</Typography>
                </Box>
                <Box
                  sx={{
                    border: "1px solid #ccc",
                    p: 1,
                  }}
                >
                  <Typography variant="subtitle1">Late Game Items</Typography>
                </Box>
              </Box>
            </Box>
          </Box>
        </Box>
      </Box>
    </Box>
  );
};

export default ChampionDetails;
